Grêmio cansou de perder jogos fáceis em casa e a culpa é dos outros? Uma única vitória em um dos jogos ridículos que fez e perdeu e não teria caído.
Pontos corridos não é campeonato de mata mata que se resolve em um ou dois jogos.
